import React from 'react'
import CircleImg from '../images/circles.png'
import './Styles/Card.css'

class Card extends React.Component{
    render(){
        const {} = this.props
        return (
            <div className="card mx-auto Fitness-Card"style={{
                backgroundImage:`url(${CircleImg}), linear-gradient(to right, ${this.props.leftColor}, ${this.props.rightColor})`
            }}
            >
                <div className="card-body">
                    <div className="row center">
                        <div className="col-6">
                            <img src={this.props.img} alt="Technique Guides"/>
                        </div>
                        <div className="col-6 Fitness-Card-Info">
                            <h1>{this.props.title}</h1>
                            <p>{this.props.description}</p>
                        </div>
                    </div>
                </div>
            </div>
            
        )
    }
}

export default Card
